		<script>

	 
		$(document).ready(function () {
			$('#frmRegister').submit(function (event) {
				var dob = $('#DateOfBirth').val();
				var age = calculateAge(dob);
				if (age < 18) {
					event.preventDefault();
					$('#age-error').show();
				}
